# frozen_string_literal: true

require "test_helper"

class TestLongestSubstring < Minitest::Test
  def test_first_case
    assert length_of_longest_substring("abcabcbb") == 3
  end
  
  def test_second_case
    assert length_of_longest_substring("bbbbb") == 1
  end
  
  def test_third_case
    assert length_of_longest_substring("pwwkew") == 3
  end
  
  def test_fourth_case
    assert length_of_longest_substring("p") == 1
  end
  
  def test_fifth_case
    assert length_of_longest_substring("") == 0
  end

  def test_sixth_case
    assert length_of_longest_substring("aab") == 2
  end
  
  def test_seventh_case
    assert length_of_longest_substring("dvdf") == 3
  end
  
  def test_eighth_case
    assert length_of_longest_substring("anviaj") == 5
  end
  
  def test_nineth_case
    assert length_of_longest_substring("ggububgvfk") == 6
  end

